import React from "react";
import {getTr} from "../actions/tr.action";




const AdminTr = () => {


    const getUnhandledTr = (event) => {
        event.preventDefault();
        dispatch(getTr());

    };


    return (
        <div>
            <h1>Floor plans</h1>
        </div>
    );

}

export default AdminTr;
